{

    constructor(props:IProps)
    {
     super(props)
     this.state={
         cMessage:'Iam from Child'
     }
        }
    

  
    

render()
{
return(
<React.Fragment>
    <section  className='mt-5'>
        <div className='container'>
            <div className='row'>
                <div className='card'>
                    <div className='card-body'>
                        <p>Iam Child</p>
                        <button className='btn btn-primary'></button>
                    </div>
                </div>
            </div>
        </div>
      
    </section>

</React.Fragment>
)
}
}
export default ChildComponent
